import axios from 'axios';

export const GET_DOGS = 'GET_DOGS';


export const getDogs = () => {
  return (dispatch) => {
      axios.get('http://localhost:3001/dogs')
      .then( (res) => {
        dispatch({
          type: GET_DOGS,
          payload: res.data,
        });
      })
      .catch( (err) => console.log(err));
  }
}
